// src/components/Dashboard.js
import React, { useState, useEffect } from 'react';
import { toast } from 'react-toastify';
import axios from 'axios';

const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:5005/api';

const Dashboard = () => {
  const [clientId, setClientId] = useState(localStorage.getItem('clientId') || '');
  const [loading, setLoading] = useState(false);
  const [oxCodes, setOxCodes] = useState([]);
  const [clientInfo, setClientInfo] = useState(null);

  useEffect(() => {
    fetchOxCodes();
  }, []);

  const fetchOxCodes = async () => {
    setLoading(true);
    try {
      const response = await axios.get(`${API_URL}/ox-codes`, { withCredentials: true });

      if (response.data && Array.isArray(response.data)) {
        setOxCodes(response.data);
      }
    } catch (error) {
      console.error('Error fetching OX codes:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="row">
      <div className="col-md-12">
        <div className="card">
          <div className="card-header bg-success text-white">
            <h4>Authentication Successful</h4>
          </div>
          <div className="card-body">
            <div className="alert alert-success">
              <h5>Welcome, Client ID: {clientId}</h5>
              <p className="mt-2">
                You have been successfully authenticated with the Motilal Oswal API.
              </p>
            </div>

            <div className="alert alert-info mt-4">
              <h5>Next Steps</h5>
              <p>
                You are now authenticated with the Motilal Oswal Financial Services API.
                Your authentication has been completed successfully, and your session is active.
              </p>
              <p className="mb-0">
                For any issues or support, please contact your account manager.
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
